import { Injectable } from '@angular/core';
import {AngularImageViewer} from '../angular-image-viewer/models/angular-image-viewer.model';
import {Observable, of} from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class ImagesMockService {

  constructor() { }

  public geImages(): Observable<Array<AngularImageViewer>> {
    return of(this.mockImages());
  }

  private mockImages() : Array<AngularImageViewer> {
    return [
      {
        title: 'Royal Enfield Interceptor Vermelha',
        base64Image: 'data:image/jpeg;base64,'
      },
      {
        title: 'Royal Enfield Tanque cromado',
        base64Image: 'data:image/webp;base64,'
      },
      {
        title: 'Royal Enfield Super Meteor na estrada',
        base64Image: 'data:image/jpeg;base64,'
      },
      {
        title: 'Royal Enfield Super meteor vermelha',
        base64Image: 'data:image/jpeg;base64,'
      }
    ];
  }
}
